import React from 'react';
import './App.css';

export default class App extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
          value: "Not Clicked",
          data: "NA"
        };
        this.pyth = this.pyth.bind(this)
    }

    //const vars = new FormData(document.getElementbyID('login-form'));

    pyth() {
      const obj = {weather: 'weather'};
      fetch("/api", {
        method: 'POST',
        headers: {'Content-Type': 'application/json',
      },
      body: JSON.stringify(obj),
    })
        .then(res => res.json())
        //.then(data => this.setState({data: data.message}));
        .then(this.setState({data: document.getElementbyID('SkyConditions')}))
    }

    render() {
        return <div className="App">
            <div className="Test">
                <button onClick={this.pyth}>Mint</button>
                <div className="Test">
                    <span>{this.state.data}</span>
                </div>
            </div>
        </div>;
    };
};
